import React, {useState, useEffect} from "react";
import { apiGet } from "../utils/api";
import { useParams } from "react-router-dom";


export const PurchasesTable = (items) => {

    const {identificationNumber} = useParams();

    const[purchases, setPurchases] = useState([]);

    useEffect(() => {
        apiGet("/api/identification/" + identificationNumber + "/purchases").then((data) => setPurchases(data));
    },[]);

    return (
        <div>
            <p>
                <em></em>Přijaté faktury
            </p>
            
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Dodavatel</th>
                        <th>Datum splatnosti</th>
                        <th>Produkt</th>
                        <th>Cena</th>
                    </tr>
                </thead>
                <tbody>
                    
                        <tr>    
                            <td></td>
                            <td>{purchases.seller}</td>
                            <td>{purchases.dueDate}</td>
                            <td>{purchases.product}</td>
                            <td>{purchases.price}</td>
                            </tr>    
                        
                </tbody>
            </table>
        </div>
    
    )
}
